const UnitDelete = (unit) => {
    console.log("unitObject", unit);
    axios
        .delete("http://localhost:3001/units", { data: { id: unit.id } })
        .then((response) => {
            console.log("Post response", response.data);
            console.log("Unit deleted");
        });
};

const Unit = (props) => {
    const handleDelete = () => {
        UnitDelete(props.unit);
    };

    return (
        <div className="unit">
            <h2>
                {props.code} {props.title}
            </h2>
            <button type="submit" onClick={handleDelete}>
                Delete
            </button>
        </div>
    );
};

export default Unit;
